import { Ingreso } from "./ingreso.model";
export class IngresoServicio {
  constructor() {
    this.ingresos = [new Ingreso("Salario", 4000), new Ingreso("Venta Coche", 500)];
  }
  eliminar(ingreso) {
    const indice = this.ingresos.indexOf(ingreso);
    this.ingresos.splice(indice, 1);
  }
}
